function Header(props) {
  //   const logo = <img src="./Google_Keep.png" alt="logo" />
  return (
    <div className="header">
      <img
        src="./Untitled.jpg"
        alt="logo1"
        style={{ width: 100, height: 100 }}
      />
      <img
        src="https://reactjs.org/logo-og.png"
        alt="react logo"
        style={{ width: "400px" }}
      />
      <h3>Keep1 </h3>
    </div>
  )
}

export default Header
